--
-- Name: hashtagGeomPastDay(text); Type: FUNCTION; Schema: tweetwatcher; Owner: -
--

CREATE FUNCTION "hashtagGeomPastDay"(hashtag text) RETURNS text
    LANGUAGE plpgsql
    AS $_$
DECLARE json text;
BEGIN
SELECT
	ST_AsGeoJSON(ST_Collect(geom)) INTO json
FROM
	tweetwatcher."tweetHashtags_rel" as rel
INNER JOIN
	tweetwatcher.hashtags ON hashtags.id = rel."hashtagId"
INNER JOIN
	tweetwatcher.tweets ON tweets.id = rel."tweetId"
WHERE
	rel."dateAdded" > NOW() - '1 day'::interval
AND
	hashtags.hashtag = $1;
RETURN json;
END
$_$;


--
-- Name: insertHashtag(character varying, integer); Type: FUNCTION; Schema: tweetwatcher; Owner: -
--

CREATE FUNCTION "insertHashtag"(ht character varying, tid integer) RETURNS integer
    LANGUAGE plpgsql
    AS $_$
DECLARE htid integer;
  BEGIN
	SELECT id INTO htid FROM tweetwatcher.hashtags WHERE hashtag = $1 LIMIT 1;
	IF htid IS NULL THEN
		WITH x AS (
			INSERT INTO tweetwatcher.hashtags (hashtag) VALUES ($1) RETURNING id
		)
		SELECT id INTO htid FROM x;
	END IF;

	INSERT INTO tweetwatcher."tweetHashtags_rel" ("tweetId", "hashtagId")
	VALUES
	($2, htid);

	RETURN htid;
  END;
	
$_$;


