--
-- Name: insertTweet(double precision, double precision, bigint, character varying, text); Type: FUNCTION; Schema: tweetwatcher; Owner: -
--

CREATE FUNCTION "insertTweet"(lat double precision, long double precision, id bigint, "user" character varying, tweet text) RETURNS integer
    LANGUAGE sql
    AS $_$
	INSERT INTO
		tweetwatcher.tweets ("tweetId", "user", "tweet", "geom", "wardId")
	SELECT
		$3 AS "tweetId",
		$4 AS "user",
		$5 AS "tweet",
		ST_SetSRID(ST_Point($2, $1), 4326) AS "geom",
		(SELECT COALESCE((SELECT id FROM tweetwatcher.wards WHERE ST_Contains(geom, ST_SetSRID(ST_Point($2, $1), 4326))), 0))
	RETURNING id;
$_$;


--
-- Name: pastDaysHashtagsByWard(integer); Type: FUNCTION; Schema: tweetwatcher; Owner: -
--

CREATE FUNCTION "pastDaysHashtagsByWard"("wardId" integer) RETURNS TABLE(geometry text, hashtag character varying)
    LANGUAGE plpgsql
    AS $_$
BEGIN
	RETURN QUERY
	SELECT
		ST_AsLatLonText(geom, 'D.DDDDDD')as geom, hashtags.hashtag
	FROM (
		SELECT
			tweets.geom, rel."hashtagId"
		FROM
			tweetwatcher."tweetHashtags_rel" as rel
		INNER JOIN 
			tweetwatcher.tweets ON tweets.id = rel."tweetId"
		WHERE tweets."dateAdded" > (NOW() - '1 day'::interval)
		AND tweets."wardId" = $1
	) AS test
	INNER JOIN 
		tweetwatcher.hashtags ON test."hashtagId" = hashtags.id;
END;
$_$;


