--
-- Name: V_avgTweetsPastWeek; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_avgTweetsPastWeek" AS
 SELECT t.hour,
    round(avg(t.count)) AS round
   FROM ( SELECT date_part('hour'::text, date_trunc('hour'::text, tweets."dateAdded")) AS hour,
            count(*) AS count
           FROM tweets
          WHERE ((tweets."dateAdded" > (now() - (now() - date_trunc('hour'::text, (now() - '7 days'::interval))))) AND (tweets."dateAdded" < (now() - (now() - date_trunc('hour'::text, now())))))
          GROUP BY date_trunc('hour'::text, tweets."dateAdded")
          ORDER BY date_trunc('hour'::text, tweets."dateAdded")) t
  GROUP BY t.hour
  ORDER BY (date_trunc('day'::text, now()) + (t.hour * '01:00:00'::interval));


