--
-- Name: V_top25HashtagsPast24Hours; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_top25HashtagsPast24Hours" AS
 SELECT (array_to_json(array_agg(t.*)))::text AS array_to_json
   FROM ( SELECT lower((hashtags.hashtag)::text) AS hashtag,
            count(hashtags.hashtag) AS count
           FROM ("tweetHashtags_rel" rel
             JOIN hashtags ON ((hashtags.id = rel."hashtagId")))
          WHERE (rel."dateAdded" > (now() - '1 day'::interval))
          GROUP BY lower((hashtags.hashtag)::text)
          ORDER BY count(hashtags.hashtag) DESC
         LIMIT 25) t;


