--
-- Name: V_tweetsByWard1DayAgo; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_tweetsByWard1DayAgo" AS
 SELECT COALESCE(wards.id, 0) AS "wardId",
    COALESCE(cnt.count, (0)::bigint) AS count
   FROM (wards
     LEFT JOIN ( SELECT tweets."wardId",
            count(*) AS count
           FROM tweets
          WHERE ((tweets."dateAdded" >= (now() - '2 days'::interval)) AND (tweets."dateAdded" <= (now() - '1 day'::interval)))
          GROUP BY tweets."wardId") cnt ON ((cnt."wardId" = wards.id)))
UNION
 SELECT 0 AS "wardId",
    count(*) AS count
   FROM tweets
  WHERE (((tweets."dateAdded" >= (now() - '2 days'::interval)) AND (tweets."dateAdded" <= (now() - '1 day'::interval))) AND (tweets."wardId" = 0))
  ORDER BY 1;


--
-- Name: V_tweetsByWardPast24Hrs; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_tweetsByWardPast24Hrs" AS
 SELECT tweets."wardId",
    count(tweets."wardId") AS count
   FROM tweets
  WHERE (tweets."dateAdded" > (now() - '1 day'::interval))
  GROUP BY tweets."wardId"
  ORDER BY tweets."wardId";


--
-- Name: V_tweetsByWardDailyChange; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_tweetsByWardDailyChange" AS
 SELECT (array_to_json(array_agg(t.*)))::text AS array_to_json
   FROM ( SELECT one."wardId",
            one.count AS "past24Hrs",
            (one.count - two.count) AS "dayChange"
           FROM ("V_tweetsByWardPast24Hrs" one
             JOIN "V_tweetsByWard1DayAgo" two ON ((one."wardId" = two."wardId")))) t;


--
-- Name: V_tweetsPast24Hrs; Type: VIEW; Schema: tweetwatcher; Owner: -
--

CREATE VIEW "V_tweetsPast24Hrs" AS
 SELECT (array_to_json(array_agg(n.*)))::text AS result
   FROM ( SELECT t.hour,
            t.count,
            average.round AS average
           FROM (( SELECT date_trunc('hour'::text, tweets."dateAdded") AS hour,
                    count(*) AS count
                   FROM tweets
                  WHERE ((tweets."dateAdded" > (now() - (now() - date_trunc('hour'::text, (now() - '1 day'::interval))))) AND (tweets."dateAdded" < (now() - (now() - date_trunc('hour'::text, now())))))
                  GROUP BY date_trunc('hour'::text, tweets."dateAdded")
                  ORDER BY date_trunc('hour'::text, tweets."dateAdded")) t
             LEFT JOIN "V_avgTweetsPastWeek" average ON ((date_part('hour'::text, t.hour) = average.hour)))) n;


